function saveUserChanges(n){let t={id:n,username:document.getElementById("edit-username").value,email:document.getElementById("edit-email").value,password:document.getElementById("edit-password").value};$.ajax({url:"/SaveUserChanges",type:"POST",dataType:"html",data:t,success:function(n){n?(searchUser(),$("#edit-user-modal").modal("hide")):(searchUser(),$("#edit-user-modal").modal("hide"),alert("Save did not work"))},error:function(){}})}